:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Caroline Elizabeth and LUDBROOK, Samuel Blomfield
  VLUDBROOK, Henry Samuel (Harry) and KINSELLA, Hana
  JLUDBROOK, Ronald Henry and GREENING, Dorothy
  LUDBROOK, Ronald Henry and GREENING, Dorothy (cont...)
  brother, Hereward.
  Dorothy worked as a private secretary. She met Ronald in England and came to New Zealand to be married. She
  was an accomplished pianist and singer and was skilled at all forms of needlework, embroidery and knitting.
  She was an avid reader, and also taught Sunday School at Pakaraka for many years.
  01> LUDBROOK, John Hereward
  b 14.01.1929 d 23.09.1956
  John was educated at Dilworth School and qualified as an architect at Auckland University where he was
  president of the University Evangelical Union and did holiday work with the Children's Special Service
  Mission. Hereward's interests included reading, debating and studying religious thought.
  02> LUDBROOK, Barbara Rosemary m on 07.05.1955 to WHITE, Robert Edwin
  b 20.10.1930
  b 02.09.1930
  Barbara b. at Pakaraka, Bay of Islands and m. at St George's Church, Epsom,
  Auckland. Robert, slo David Cornwall White and Dorothy Armorel Way, b. at
  Devonport, Auckland. Address: 54 Peter Terrace, Castor Bay, Auckland 9.
  Barbara was educated by Correspondence School and at Epsom Girls' Grammar
  School, Auckland. She graduated as a primary school teacher (1950) and
  obtained her National Playcentre Supervisor's Certificate (1967), BA (1979),
  MA (1983) and PhD in Social Anthropology (1992). She has been a University tutor in Anthropology since
  1984 and a co-director of Broad Perspectives, a social research company, since 1991. Her interests
  include music, gardening, pottery, conservation, bushwalking, swimming and skiing.
  Robert was educated at Vauxhall School and Takapuna Grammar School, Auckland. He graduated BSc (1952),
  MSc (1954), PhD and DSc (1982). He was a Research Associate at MIT, Boston (1958-59), Senior
  Commonwealth Research Fellow (1960-62), Senior Lecturer at Auckland University (1963-65), Associate
  Professor (1965-90), Associate Professor ETH, Zurich (1972) and Director of the Centre for Peace
  Studies at the University of Auckland (1988-). His interests include music, yachting, skiing and
  politics.
  01> WHITE, Rosemary Gillian
  b 04.12.1956
  Rosemary b. at Auckland. Address: C/- Biology Department, Monash University, Clayton 3168, Vic,
  Australia.
  Rosemary was educated at Campbell's Bay School, Westlake Girls' High School, Auckland University
  (MSc in Botany) and Utah State University, USA (PhD in 1987). She did post-doctoral work at Ohio
  State University (1985-87) and at Sydney University (1987-93), and since then has been a lecturer
  at Monash University, Melbourne, Australia. Her interests include reading, films, music, theatre,
  bushwalking, swimming, skiing and peace activism.
  02> WHITE, Christopher Stephen m on 28.01.1984 to NEWTON, Claire Elizabeth
  b 05.04.1959
  b 30.06.1961
  Christopher b. at Boston, USA. Claire, d/o Harold and Janet Newton, b. in Taranaki, Address: PO
  Box 1470, Yeppoon, Queensland 4703, Australia.
  Christopher was educated at Campbell's Bay School, Westlake Boys' High School and Auckland
  University (MSc in Zoology, PhD 1992). He has worked as an environmental consultant, a project
  manager and waste management manager for Milburn NZ Ltd and moved to his current position with
  Queensland Cement Ltd, a Company Manager of Pacific Lime, in 1996. His interests include reading,
  music, natural history, environmental issues, biological theory, outdoor pursuits and Bible study.
  Claire was educated at New Plymouth Girls' High School, Massey University (DipHort 1980) and
  Auckland University (BSc 1990). Her entire career has been in horticulture and she has worked as a
  landscape designer and has managed a major mining restoration operation and nursery in Westport.
  Currently she is running a specialist organic herb nursery at Yeppoon while raising two small boys.
  Her interests include gardening, herbal medicine, Bible study, natural history, botany, singing,
  lifestyle farming and photography.
